import React from 'react';

class Meeting extends React.Component {
  render() {
    return (
      <React.Fragment>
        <a href="/">Home</a>
        <p>Page containing full availability data from all meeting participants</p>
      </React.Fragment>
    )
  }
}

export default Meeting
